import axios from "axios"
import './App.css';


function App() {
  function handleClick() {
    const result = axios.get("https://jsonplaceholder.typicode.com/users");
    console.log(result);
  }

  return ( 
    <div className="App">
      <h1>Users List</h1> 
      <button onClick = { handleClick }>Get Users</button>
    </div>
  );
}

export default App;
